import React from 'react';
import './Listagem.css';

const Listagem = ({ simulacoes }) => {
  const linhasTabela = [];

  for (const simulacao of simulacoes) {
    for (const [index, unidade] of simulacao.unidades.entries()) {
      linhasTabela.push(
        <tr key={`${simulacao.id}-${index}`}>
          <td>{simulacao.id}</td>
          <td>{simulacao.nomeCompleto}</td>
          <td>{simulacao.email}</td>
          <td>{simulacao.telefone}</td>
          <td>{unidade.codigoDaUnidadeConsumidora || 'N/A'}</td>
          <td>{unidade.modeloFasico || 'N/A'}</td>
          <td>{unidade.enquadramento || 'N/A'}</td>
          <td>{unidade.historicoDeConsumoEmKWH?.[0]?.consumoForaPontaEmKWH || 'N/A'}</td>
        </tr>
      );
    }
  }

  return (
    <div>
      <h2>Listagem de Simulações</h2>
      <table className="listagem-table">
        <thead>
          <tr>
            <th>ID</th>
            <th>Nome</th>
            <th>Email</th>
            <th>Telefone</th>
            <th>Código da Unidade</th>
            <th>Modelo Fásico</th>
            <th>Enquadramento</th>
            <th>Histórico de Consumo em kWh</th>
          </tr>
        </thead>
        <tbody>{linhasTabela}</tbody>
      </table>
    </div>
  );
};

export default Listagem;
